  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130769 includes physical
  and profile data collected aboard NOAA Ship FAIRWEATHER during project M-R908-FA-08
  in the Bering Sea and North Pacific Ocean from 2008-08-08 to 2008-08-09. These data
